import todos from "./App.js"

function TodoList({todos}) {
  return (
    <ul className="TodoList">
      {todos.map((todo)=> (
        <TodoListItem>
          todo= {todo}
          key = {todo.id}
        </TodoListItem>
      ))}
    </ul>
  )
}
